import * as React from "react";
import { useState } from "react";
import "./Stylesheets/LoginPage.css";
import { Button, Link, Box, Typography } from "@mui/material";
import axios from "./api/axios";
import Users from "./Users";
import useLogout from "./hooks/useLogout";
import { useNavigate, useLocation } from "react-router-dom";
import Alert from "@mui/material/Alert";
import CheckIcon from "@mui/icons-material/Check";
import CloseIcon from "@mui/icons-material/Close";
import { IconButton } from "@mui/material";
import { useEffect } from "react";
import studentImage from "./images/image.webp";

function DashboardPage() {
  const [result, setResult] = useState("");
  const [open, setOpen] = useState(false);
  const [message, setMessage] = useState("");
  const logout = useLogout();
  const navigate = useNavigate();

  const signOut = async () => {
    await logout();
    navigate("/login");
  };

  axios
    .get("/dashboard")
    .then((response) => {
      setResult(response.data.login);
      console.log(response.data.login);
    })
    .catch((err) => {
      console.log(err);
    });
  return (
    <Box
      sx={{ display: "flex", justifyContent: "center", alignItems: "center" }}
    >
      <Typography variant="h1">Przeprowadzaj zdalne zajęcia</Typography>
      <Typography variant="h1">szybko i wygodnie!</Typography>
      <Typography variant="h3">
        Nasza platofrma uczelniana do zdalnych testów pozwoli Ci wejść na wyższy
        poziom e-learningu!
      </Typography>
    </Box>
  );
}

export default DashboardPage;
